import React from "react";

class Fish extends React.Component {
  render() {
    return (
      <div className="single-fishes">
        <img
          src={this.props.fishDetails.img}
          alt={this.props.fishDetails.name}
        />
        <h3>{this.props.fishDetails.name}</h3>
      </div>
    );
  }
}

export default Fish;
